import React from 'react';
import './App.css';
import Home from './Components/Home';
import Navbar from './Components/Navbar';
import CustomGPT from './Components/CustomGPT';


function App() {


  return (
    <div>
      <Navbar />
      <main className="mt-5">
        <section id="customGPT" className="pt-12">
          <CustomGPT/>
        </section>
      </main>
    </div>



  );
}

export default App;
